column8:
　吸汗速乾に加え、脱臭機能も付いたエコピュア素材を使用したチュニック。アシンメトリーなデザインですが、裾のドローコードを調節することで異なるシルエットも楽しむことができます。ソフトな生地とパステルカラーで柔らかな印象です。<br>
■カラー：LGY AE8709、SAX AE8711<br>
■サイズ：S、M、L<br>
S（身長152～158cm、胸囲78～82cm）<br>
M（身長157～163cm、胸囲81～85cm）<br>
L（身長162～168cm、胸囲84～88cm）<br>
■素材：シングルジャージー ポリエステル100％<br>
